import React, { useState } from 'react';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import axios from 'axios';

function ProfilePage() {
    const [profileImage, setProfileImage] = useState('https://via.placeholder.com/150');
    const [signatureImage, setSignatureImage] = useState('https://via.placeholder.com/150');

    const formik = useFormik({
        initialValues: {
            fullName: 'John Doe',
            email: 'john.doe@example.com',
            bio: '',
            availableTime: '',
            registeredId: '',
            workingHospitals: '',
            age: '',
            contactNo: ''
        },
        validationSchema: Yup.object({
            // Your validation schema
        }),
        onSubmit: async (values) => {
            try {
                const response = await axios.post('http://localhost:5000/update-profile', values);
                console.log('Profile updated:', response.data);
                alert('Profile updated successfully!');
            } catch (error) {
                console.error('Failed to update profile:', error);
                alert('Failed to update profile.');
            }
        },
    });

    const handleImageChange = (file, setImage) => {
        if (file) {
            setImage(URL.createObjectURL(file));
        }
    };

    // Your component rendering
}

export default ProfilePage;
